import React, { useContext } from 'react';
import { FaShoppingCart, FaUserCircle } from 'react-icons/fa';
import { Link } from 'react-router-dom';
import styled, { keyframes } from 'styled-components';
import { colorContext } from './ColorContextProvider'; // Import your color context

// Keyframes for animations
const fadeIn = keyframes`
  0% {
    opacity: 0;
    transform: translateY(30px);
  }
  100% {
    opacity: 1;
    transform: translateY(0);
  }
`;

// Other keyframes for animation (orbit, float, etc.) remain the same

const Landing = () => {
  const { config } = useContext(colorContext); // Access the context

  return (
    <Container>
      <Left theme={config.landing.left} textColor={config.landing.textLeft}>
        <TextLeft theme={config.landing.textLeft} textSpan={config.landing.textLeftSpan}>
          V <span className="i">I</span>
        </TextLeft>
      </Left>

      <Center>
        <ShopLink className="shopLink" href="#shop" theme={config.landing.shopLink}>V</ShopLink>
        <ShopLink className="shopLink2" href="#shop" theme={config.landing.shopLink}>I</ShopLink>
        <ShopLink className="shopLink3" href="#shop" theme={config.landing.shopLink}>O</ShopLink>
        <ShopLink className="shopLink4" href="#shop" theme={config.landing.shopLink}>L</ShopLink>
        <ShopLink className="shopLink5" href="#shop" theme={config.landing.shopLink}>A</ShopLink>
        O
      </Center>

      <CenterButtons>
        <Link to="/store">
          <StoreButton bgColor={config.landing.centerButtons} hoverColor={config.landing.centerButton2}>
            فروشگاه
          </StoreButton>
        </Link>
      </CenterButtons>

      <CenterButtons2>
        <Link to="/about">
          <AboutButton bgColor={config.landing.centerButton2} hoverColor={config.landing.centerButton2Link}>
            درباره ما
          </AboutButton>
        </Link>
      </CenterButtons2>

      <Right theme={config.landing.right} textColor={config.landing.textRight}>
        <TextRight theme={config.landing.textRight}>
          L <span className="a">A</span>
        </TextRight>
      </Right>
    </Container>
  );
};

// Styled Components
const Container = styled.div`
  display: flex;
  height: 100vh;
  width: 100%;
  position: relative;
  opacity: 0;
  font-family: 'Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif;
  animation: ${fadeInContainer} 2s ease-in-out forwards;
`;

const Left = styled.div`
  flex: 1;
  height: 100%;
  background: ${(props) => props.theme};
  backdrop-filter: blur(18px);
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
`;

const Right = styled.div`
  flex: 1;
  height: 100%;
  background: ${(props) => props.theme};
  backdrop-filter: blur(18px);
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
`;

const Center = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  font-family: 'Times New Roman', Times, serif;
  transform: translate(-50%, -50%);
  font-size: 300px;
  font-weight: bold;
  color: ${(props) => props.theme};
  text-shadow: 4px 4px 40px rgba(0, 0, 0, 0.3);
  z-index: 2;
  opacity: 0;
  animation: ${fadeIn} 3s ease-in-out forwards, ${float} 2s infinite ease-in-out;
  cursor: pointer;
`;

const ShopLink = styled.p`
  position: absolute;
  font-size: 20px;
  font-weight: bold;
  color: ${(props) => props.theme};
  text-decoration: none;
  opacity: 0.5;
  z-index: 3;
  transition: color 0.3s ease, transform 0.3s ease;
  cursor: pointer;

  &:nth-child(1) {
    animation: ${orbit1} 12s infinite linear;
  }
  &:nth-child(2) {
    animation: ${orbit2} 14s infinite linear;
  }
  &:nth-child(3) {
    animation: ${orbit3} 16s infinite linear;
  }
  &:nth-child(4) {
    animation: ${orbit4} 18s infinite linear;
  }
  &:nth-child(5) {
    animation: ${orbit5} 20s infinite linear;
  }
`;

const CenterButtons = styled.div`
  z-index: 100;
  right: 50%;
  top: 80%;
  position: absolute;
`;

const CenterButtons2 = styled.div`
  z-index: 100;
  top: 80%;
  left: 50%;
  position: absolute;
`;

const StoreButton = styled.button`
  color: white;
  z-index: 100;
  border-radius: 50px 0px 0px 500px;
  background-color: ${(props) => props.bgColor};
  border: none;
  padding: 30px;
  font-family: 'Vazir', 'Playfair Display', serif;
  text-align: center;

  &:hover {
    background-color: ${(props) => props.hoverColor};
    transform: scale(1.05);
  }

  &:active {
    background-color: ${(props) => props.hoverColor};
    transform: scale(1);
  }
`;

const AboutButton = styled.button`
  color: white;
  z-index: 100;
  border-radius: 0px 50px 500px 0px;
  background-color: ${(props) => props.bgColor};
  text-align: center;
  border: none;
  font-family: 'Vazir', 'Playfair Display', serif;
  padding: 30px;
`;

const TextLeft = styled.div`
  font-size: 120px;
  font-weight: bold;
  color: ${(props) => props.theme};
  z-index: 1;
  opacity: 0;
  animation: ${fadeIn} 2s ease-in-out forwards;
  animation-delay: 0.5s;
  cursor: pointer;
  font-family: 'Times New Roman', Times, serif;
  transition: transform 0.4s ease, color 0.3s ease, text-shadow 0.4s ease;
`;

const TextRight = styled.div`
  font-size: 120px;
  font-weight: bold;
  color: ${(props) => props.theme};
  z-index: 1;
  opacity: 0;
  animation: ${fadeIn} 2s ease-in-out forwards;
  animation-delay: 1s;
  font-family: 'Times New Roman', Times, serif;
  transition: transform 0.4s ease, color 0.3s ease, text-shadow 0.4s ease;
`;

export default Landing;
